import React from 'react';
import withStyles from '@material-ui/core/styles';
import { Card, Cardmedia, CardContent, Typography, CardMedia } from '@material-ui/core'

function Cards(props) {
    return (
        <Card>
            <CardMedia />
            <CardContent>
                <Typography variant="h6" color="textSecondary" component="p">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras eleifend sagittis massa.
                    Vestibulum pellentesque bibendum metus iaculis tincidunt.
                </Typography>
            </CardContent>
        </Card>

    );
}

export default Cards;
